import React from 'react';
import Match from './match.js';

const MatchList = ({ matches }) => {
  return (
    <div className="match-list">
      {matches.map((match) => (
        <Match key={match.matchId} match={match} />
      ))}
    </div>
  );
};

export default MatchList;
